import './estilos.css'
import bb8 from "../../../assests/bb8.png"

export default function ListUser({value,image }) {
    return (
        <div class="container">
          <text class="textUser" > {value} </text>
          <text >{image} </text> 

            <text class="textBoot" >  {value} </text>

        </div>
    );
}
